import React, {Component} from 'react'
import {Link} from 'react-router-dom'

class Navbar extends Component{
    render(){
        let activeReg = this.props.location.pathname ? "/register" : true
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login <Link style={linkStyle} to="/register">Register</Link></h2>
                    <hr/> 
              
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}
const linkStyle = {
    textDecoration: "none",
    color: "black"
}
if (activeReg){
    linkStyle = {
        textDecoration: "none",
        color: "blue"
    }
}

export default Navbar;
